import React, { Component } from "react";
import "./CompanyNews.css";

class CompanyNews extends Component
{
    render() 
    {
        console.log(this.props.news);
        return (
            <div className="news_container">
               {
                this.props.news.map(item=>
                    (
                        <div>

                                {item.source}

                        </div>
                    )) 
               }
           </div>
        );
    }
}

export default CompanyNews;
